INSERT INTO `versions` VALUES (4,'4.12.0','2023-01-16 11:06:15','~g~~h~~h~',1171210495,'{FFFFFF}- Correção nas mensagens do morro que apareciam mesmo desativadas no /menu.\n- Aumentada a velocidade de pixação de 5 por cento para 15 por cento.\n- Removidas as mensagens no chat visíveis na tela de login.\n- Removida a tela de login especial de Natal.\n- Correção do /revistar para mostrar drogas corretamente.\n- Alteração de títulos para uma posição mais alta.\n- Correção do sistema de reembolso de sócio (dentro de 10 dias) após a compra.\n- Correção do /mudarlocal para ORG, Casas, Empresas, Emprego e Família.\n- Mudança da tranca/destranca de casa de /chave para /casa chave.\n- Drogas coletadas em TRs agora são acumuladas no inventário.\n- Adiciona atalhos de comandos (/rbloqueio -> /rbq) (/rbarreira -> /rbr) (/abordar -> /ab)\n- Atualização dos comandos do Ajuda > Organização.\n{FFFF00}- Aumenta itens da Caixa Surpresa Item Veicular de 6 itens para 37 itens.\n    {FFFF99}- Caixa de Som G, Caixa de Som P, Neon Roxo, Neon Azul, Neon Amarelo, Neon Vermelho, \n    - Neon Branco, Spot Verde, Spot Amarelo, Spot Vermelho, Spot Verde Claro, Spot Laranja, \n    - Roda Offroad, Roda Shadow, Roda Mega, Roda Rimshine, Roda Wires, Roda Classic, Roda Twist, \n    - Roda Cutter, Roda Switch, Roda Grove, Roda Import, Roda Dollar, Roda Trance, Roda Atomic, \n    - Roda Ahab, Roda Virtual, Roda Access, Spoiler Sultan Alien, Spoiler Sultan X-Flow, \n    - Spoiler Elegy Alien, Spoiler Elegy X-Flow, AK-47 Veicular, M4 Veicular, RPG Veicular, \n    - Minigun Veicular, Deagle Veicular.'),(5,'4.12.1','2023-01-16 12:00:44','~g~~h~~h~',1171210495,'{FFFFFF}- Correção do /dominar para as Forças Armadas.\r\n- Corrige comando administrativo para vender propriedades.\r\n- Corrige bug ao administrador destruir baú.\r\n- Remove marca e mensagem de logout ao admin de TV sair do servidor.\r\n- Corrige títulos mostrados com hífen (-).\r\n- Corrige bug de acessórios surgirem em veículos de inventário.\r\n- Corrige bug de tentar abrir portão da La Sante ao apertar C a pé.\r\n- Corrige texto de Ping da arena para players que não estão lá.\r\n- Cancela tempo de Anti-SpawnKill ao se equipar na organização ou com /kitsocio.\r\n- Corrige bug do /trancar veículos de família\r\n- Corrige bug de veículo inválido na lista após negociar veículo.'),(6,'4.12.2','2023-01-17 12:00:44','~g~~h~~h~',1171210495,'{FFFFFF}- Adiciona farol automático para veículos entre as 18h e 7h.\r\n- Corrige sistema de plantação de maconha (reduz tempo de crescimento de 300 minutos para 30 minutos).\r\n- Remove mapa de Natal da praça.\r\n- Corrige bug de falta de chave ao ligar veículo.'),(7,'4.12.3','2023-01-20 16:00:44','~g~~h~~h~',1171210495,'{FFFFFF}- Adiciona cor da organização no /procurados.\r\n- Remove a pontuação do morro para COPs sem farda.\r\n- Adiciona ping e packet loss na mensagem de quando player cai do servidor.\r\n- Aumenta valor máximo distribuído para COPs de 35k para 1kk.\r\n- Aumenta valor máximo distribuído de bolsa família de 200k para 3kk.\r\n- Aumenta valor máximo distribuído para ORGs neutras de 20k para 800k.\r\n- Aumenta valor máximo distrubído para ORG COP de 35k para 500k.\r\n- Aumenta valor máximo de salário das organizações.'),(9,'4.12.4','2023-09-06 15:44:25','~g~~h~~h~',1171210495,'{FFFFFF}- Altera o nome de Sócio Power para Sócio Premium.\n- Reduz o valor mensal para sócios Premium, Supreme e Extreme.\n- Corrige bugs nas casinhas do governo.\n- Corrige bug que não permitia cumprir contrato em área neutra.\n- Melhora anti-airbreak / anti-teleport do servidor.'),(10,'4.12.5','2023-01-26 11:04:52','~g~~h~~h~',1171210495,'{FFFFFF}- Atualiza textdraw do relógio para Android.\n- Atualiza textdraw de barra de vida para Android.\n- Atualiza design do textdraw do velocimetro.\n- Ignora última posição se o jogador crashar na tela de login.\n- Corrige negociação de casas e empresas\n- Adiciona comando /nickindevido para administradores.\n- Corrige perdas ao trocar de nick.\n- Corrige bug no limite de casas de Sócio Extreme.\n- Corrige bug no limite de empresas para Sócio Extreme.'),(11,'4.12.6','2023-10-04 09:16:46','~g~~h~~h~',1171210495,'{008800}- Lançamento do sistema de Placas de Texto personalizáveis.\n{FFFFFF}- Correção do sistema de apreensão de veículos da PRF.\n- Correção do sistema de votação para administradores.\n- Melhoria dos eventos Hay e Survival para evitar troll.\n- Atualização de pickups e ícones no mapa das empresas.'),(12,'4.12.7','2023-02-04 16:50:00','~g~~h~~h~',1171210495,'{008800}- Criação de novo emprego de Entregador de Pizza.\r\n{FFFFFF}- Atualiza organização do sistema de pegar empregos.'),(13,'4.12.8','2023-02-19 12:00:00','~g~~h~~h~',1171210495,'{FFFFFF}- HQ Taxista alterada para a Unity Station (atrás do respawn civil).\r\n- Corrigido o bug de limite de veículos de emprego.\r\n- Alterada a permissão para o comando /online de admins.\r\n- Atualizadas as mensagens automáticas do servidor.'),(14,'4.12.9','2023-03-05 19:56:22','~g~~h~~h~',1171210495,'{00FF00}- Atualização do lucro das propriedades:\r\n	{FFFFFF}- O lucro diário será de {FFFF00}$576.000{FFFFFF} a até {FFFF00}$1.008.000{FFFFFF} para propriedades em Los Santos.\r\n	- Para propriedades fora de Los Santos, de {FFFF00}$864.000{FFFFFF} a até {FFFF00}$1.296.000{FFFFFF}.\r\n	- OBS: Somente propriedades que possuem insumos recebem os lucros!\r\n\r\n{00FF00}- Atualização do lucro das fazendas:\r\n	{FFFFFF}- O lucro diário será de {FFFF00}$1.152.000{FFFFFF} a até {FFFF00}$2.160.000{FFFFFF}.\r\n	- OBS: Somente fazendas que possuem produtos recebem os lucros!\r\n\r\n- Correção do bug de transferência de casas, propriedades e fazendas em negociação.\r\n- Removida a Caixa \"Vencida\" e não poderá mais ser aberta.'),(15,'4.12.10','2023-06-14 07:03:24','~g~~h~~h~',1171210495,'{FFFFFF}- Modernização dos textos dos menus das organizações.\r\n\r\n{00FF00}- Mudança e realocação de HQ\'s do Servidor:\r\n   {FFFFFF}- ROTA\r\n   - Governo\r\n   - Policia Federal\r\n   - As FARC\r\n   - Ballas\r\n\r\n{00FF00}- Mudança de nomes das organizações:\r\n   {FFFFFF}- Seville Boulevard >> Crips\r\n   - Estado Islâmico >> Al-Qaeda\r\n\r\n{00FF00}- Adicionamento de Elevadores para organizações:\r\n   {FFFFFF}- Governo\r\n   - Ballas\r\n\r\n- Correção do bug da tela de login com carregamento à esquerda.\r\n- Correção do bug da Van de Equipamentos da organização Ballas.\r\n- Alteração de permissões de comandos administrativos.\r\n- Atualização dos Créditos do Servidor.'),(16,'4.13.0','2023-06-21 08:00:00','~g~~h~~h~',1171210495,'{FFFFFF}- Portões da HQ ROTA adicionados.\r\n- Remoção do bug do som de retirar órgãos.\r\n- Adicionado mensagem do inicio da retirada de órgãos à vitima para todos do servidor.\r\n- Som do Toque de Recolher corrigido e funcional.\r\n- Novas perguntas do Evento Quiz (Ainda possivelmente bugado)\r\n\r\n{00FF00}- Mudança na economia geral\r\n  {FFFFFF}- Novato começará de {00FF00}3000$ {FFFFFF}para {00FF00}5000${FFFFFF} de dinheiro.\r\n  - Custo do SMS aumentou de {00FF00}3${FFFFFF} para {00FF00}10${FFFFFF}.\r\n  - Preço da retirada do veículo apreendido no pátio da P.R.F passou de {00FF00}400${FFFFFF} para {00FF00}800${FFFFFF}.\r\n\r\n- Nova Caixa Surpresa - {FF0000}Revoltado\r\n\r\n{FFFFFF}- Presente para novatos e jogadores veteranos com Sócio Premium de {00FF00}5{FFFFFF} dias.\r\n(Caso possuir Sócio, será acrescentado {00FF00}5{FFFFFF} dias ao plano atual, independentemente de qualquer sócio)\r\n\r\n- Remoção temporária da mensagem do bug das atividades.\r\n- Novos Comandos Administrativos para serem usados pelos administradores.\r\n- Adicionado novos feriados no mês de Abril e Junho - Feriados importantes de Portugal.\r\n\r\n- Correção de variáveis menores e melhoramento de textos.'),(17,'4.13.1','2023-09-08 01:19:42','~g~~h~~h~',1171210495,'{FFFFFF}- Adicionado Interior HQ Ballas.\n- Criação da Organização Paga: San Fierro Rifas (19).\n- Criação da HQ {FF1493}Staff{FFFFFF}.\n- Criação de Sistema de Sons para Equipe de Desenvolvimento.\n\n- Modificação no Sistema de Títulos.\n(Ninguém consegue usar o título de Scripter como título personalizado, a não ser que seja usado pelos respetivos programadores).\n\n- Modificação no Sistema de Ban.\n- Modificação no Sistema de IP\'s.\n\n- Correção do GPS na localização da HQ As FARC.\n\n- Remoção temporária do bug de organizar inventário.\n\n- Modificação de permissões de comandos administrativos.\n\n- Correção de bug da organização San Fierro Rifas.\n- Adicionado portões HQ funcionais da ORG San Fierro Rifas.\n\n- Alterações de permissões de comandos administrativos.\n- Criação de novos comandos administrativos para os seus respetivos e facilitamento de organização.\n\n- Criação da Caixa Surpresa {00FF00}Poderosa{FFFFFF}. (Disponível no dia 3 de Julho)\n- Criação da {FF1493}Caixa Destaque Admin{FFFFFF}.\n- Criação da {FFFF00}Caixa Admin do Mês{FFFFFF}.\n- Criação da {FFD700}Sacola Arraiá{FFFFFF}.\n\n- Adicionado Passe {FFD700}Arraiá {FFFFFF}(Será adicionado assim que a GameMode for atualizada).\n- Programado Passe de Julho, após o Passe Arraiá.\n\n- Promoção {00FF00}100% de Cash {FFFFFF}ativada. (Recebe Cash em dobro ao que foi comprado)\n\n{FF0000}- Mudança na economia geral:\n{FFFFFF}  - Novato começará de {00FF00}5000${FFFFFF} para {00FF00}10000${FFFFFF}\n\n- Correção de pormenores não funcionais, que agora estão a funcionar.\n- Correções de bugs menores.\n\n- Modificação de variáveis e textos.'),(18,'4.13.2','2023-09-24 08:21:46','~g~~h~~h~',1171210495,'{FFFFFF}- Criação do Sistema de Doenças\n(Você agora tem no seu RG a especificar o qual tipo de doença possui)\n\n- Retorno do Sistema de Avisos (Modernizado)\n\n- HQ Governo Mapeado.\n\n- Desvalorização do Sistema de Contratos.\n(Motivo: Movimentar as organizações não assassinas)\n\n- Correção do Sistema de Baús.\n\n- Melhorado comandos administrativos com mais eficiência.\n\n- Adicionado novos comandos administrativos para os Administradores do Servidor.\n\n- Adicionado Sistema de Respawn Carros automáticos no inicio do Morro e na finalização do Morro.\n(OBS: Ao finalizar o Morro, somente os veículos na área serão respawnados.)\n\n- Correção do bug do Organizar no Inventário.\n\n- Alterações de permissões de comandos administrativos.\n\n- Correções de bugs menores.\n\n- Modificação de variáveis e textos.'),(19,'4.13.3','2023-11-06 06:01:26','~r~~h~',1171210495,'{FFFFFF}• Sistema de recuperar senha e trocar senha (inativo temporariamente)\n• Otimização geral nos módulos:\n- Acessórios\n- Bodypart\n- Veículos\n- Atividade\n- Spawn\n- Death\n- Interações\n• Criação de comandos para localizar cheaters\n• Corrigido algumas falhas do mapa\n• Modificado argumento do compilador e o mês da GameMode'),(20,'5.0','2023-12-14 10:10:13','~r~~h~',1171210495,'{FFFFFF}• Reformulação do Preço dos produtos\r\n• Sistema de Doenças (Completo)\r\n• Sistema de Ideologia Política\r\n• Reformulação da Organização Governo\r\n• Salário dos empregos reformulados (alguns controlados pelo Governo)\r\n• Correções de Bugs:\r\n- Correção Completa da Arena\r\n- Reação da Doença contida\r\n- Uso do comando acessórios\r\n• Mapa de Natal e Ano Novo\r\n• Caixa Surpresa Natal & Maleta do João\r\n• Novo Interior da Prisão La Sante\r\n• Reativação da Rádio do Servidor\r\n• Sistema de YouTubers (Ainda a ser completo)\r\n• Otimização de comandos\r\n• Passe de Natal (a partir do dia 15/12 até 26/12)\r\n• Valorização das Fazendas (aumento do salário dos Caminhoneiros pela administração do Governo)\r\n• Aumento do preço das Multas\r\n• Aumento do preço da retiração do veículo do pátio da P.R.F\r\n• Valorização dos minérios para mineradores (Governo agora tem direito a 20% do valor ganho)\r\n• Valorização do emprego Médicos (Poderá curar jogadores com doenças e receber após curar)\r\n• Criação do Cofre Administrativo (Usado pelos administradores para pegar dinheiro para fazer eventos)'),(21,'5.1','2024-02-06 06:00:42','~b~~h~',458624995,'{FFFFFF}• BUG: Organizar inventário foi resolvido.\n• BUG: Sistema de negociar (Você não é dono dessa propriedade).\n• UPDATE: Sistema de acessórios (Agora é possível usar qualquer tipo de acessório junto, não existe mais limitação de usar no mesmo local.).\n• BUG: Org-VIP foi resolvido.\n• BUG: Tempo de prisão (textdraw não desaparece ao cumprir a cadeia).\n• BUG: Nível de procurado infinito.\n• Alteração nas paletas que vem na Caixa Surpresa Supreme (Paleta Nevoa/Porcelana <>).\nOBS: Pode vim Porcelana/Nevoa (Cores: 14 e 15)\n• Passe do Theus Gravido: do dia 11 ao dia 17 de janeiro.\n• Saco do Gravido: Disponível nos presentes (6 tipos de prêmio na sorte).\nPrêmios: Acsr. Clothes M, Acsr. Two Players, Dec. Poltrona de Amamentacao, Dec. Mesa troca-fraldas, Dec. Light Blue, Dec. Light Pink.\n• Otimização no sistema de inventário e /tv.'),(22,'5.2','2024-02-06 22:00:00','~g~~h~',458624995,'{FFFFFF}• Otimização completa no inventário.\r\n• Novo estilo da tela de carregamento.\r\n• Foi aumentado o lucro das fazendas.\r\n• Pequena mudança de limite de acessórios de acordo com nível Sócio.\r\n• Mudança do nome da organização paga (19) Los Bloods.\r\n• Melhoria no sistema de PROMOÇÃO DE CASH, definir no jogo de 0 á 100%.\r\n• Adicionado o passe carnaval e o Saco de Carnaval.\r\n• BUG: Clima do jogo não acompanha corretamente.\r\n• Liberado alguns comandos para DIRETOR.\r\n• BUG: Sniper na organização VIP.\r\n• BUG: Entrar na Máfia Italiana.\r\n• BUG: Casinhas do governo.\r\n• BUG: Textdraw na tela após morrer na arena.\r\n• Otimização geral no sistema de banimento.\r\n• BUG: Atividades (resolvido)\r\n• BUG: Rádio portatil (50% resolvido)'),(23,'5.2.1','2024-03-09 01:49:02','~g~~h~',458624995,'{FFFFFF}• Reestruturação do reembolso de sócio (abaixo de 7 dias é apenas remoção do sócio)\n• Reestruturação do sistema de banimentos\n• Reestruturação do sistema da equipe rádio/locutor\n• Criação do sistema de Youtubers\n• Criação do sistema de Developers separado de Admins (50%)'),(24,'5.2.2-FINAL','2024-03-19 23:07:00','~p~',458624995,'{FFF000}2024-03-09:\n\n{FFFFFF}• Migração para o {9083d2}open.mp {FFFFFF}melhorias de performance, desempenho, otimização.\n• Reestruturação da variável de dinheiro e cash.\n• Remoção de include obsoleta.\n• Novas estatisticas no Discord, na sala #conexão você pode ver a quantidade de jogadores online.\n• Reestruturação nas animações.\n• BUG de cancelar a edição do acessório (perde o acessório) foi resolvido.\n• Comandos pelo DISCORD interagem com o jogo, como por exemplo o $infoplayer (as informações do seu personagem disponível).\n• Reformas feitas no VoIP.\n• Nova HUD no servidor com um novo estilo!\n\n{FFF000}2024-03-10:\n\n{FFFFFF}• Remoção do sistema de ideologia.\n• Sistema de criar e remover de áreas neutras in-game.\n• Melhorias no sistema de áreas neutras (SafeZone).\n• Resolvendo alguns BUGs da nova HUD.\n• Resolvendo erros em veículos duplicando.\n\n{FFF000}2024-03-14:\n\n{FFFFFF}• Resolvendo carros duplicando.\n• Restruturação no sistema de casas.\n• Concluindo o sistema de safezones.\n\n{FFF000}2024-03-15:\n\n{FFFFFF}• Leve construção da cidade de {EF9C0D}San Fierro {FFFFFF}(safezones, casas).\n• Adicionado mapa da primeira favela (Teremos mais).'),(25,'5.3.3','2024-04-09 03:26:00','~b~',1171210495,'{FFF000}2024-03-19:\n\n{FFFFFF}• Novo HUD do inventário.\n• Remoção do sistema de doenças.\n• Soluções de BUGs relatados por jogadores/equipe dev.\n• Otimização das estruturas de sistema.\n\n{FFF000}2024-03-20:\n\n{FFFFFF}• Novos comandos para a equipe de desenvolvimento.\n• Inventario ajustado com botoes maiores para os Android usar com mais facilidade.\n\n{FFF000}2024-03-30:\n\n{FFFFFF}• Novo anti-cheater.\n• SafeZones corrigidas.\n• HUD com tema de pascoa.\n• Ajuste no dano das armas.\n• Carregar posição mesmo crashando.\n• Nova praça dos presentes.\n• Algumas otimizações foram aplicadas.\n\n{FFF000}2024-04-01:\n\n{FFFFFF}• Loja de acessorios foi substituida pelo Mercado Negro de SF.\n• Novo banco de LS (interior aberto, bom para ações).'),(2