eu atual socio).'),(27,'5.4.26','2024-06-17 02:23:30','~y~',1171210495,'{FFF000}2024-05-31:\r\n\r\n{9C9C9C}1. {FFFFFF}Nova favela 4 para a GROTA!\r\n{9C9C9C}2. {FFFFFF}Mudanca do nome da TCP para BAIRRO-13\r\n{9C9C9C}3. {FFFFFF}Otimizacao de mapas\r\n{9C9C9C}4. {FFFFFF}A partir do nivel 20 e forcado a vincular o Discord com a conta.\r\n\r\n{FFF000}2024-06-11:\r\n\r\n{9C9C9C}1. {FFFFFF}Mapas de decoracao Festa Junina (Arraia)\r\n{9C9C9C}2. {FFFFFF}Mapa novo no Spawn Civil (Placa de Informacoes)\r\n{9C9C9C}3. {FFFFFF}Correção em comandos administrativos.\r\n{9C9C9C}4. {FFFFFF}Novo sistema de ARENA (novo nome: PAINTBALL), com salas privadas.\r\n\r\n{FFF000}2024-06-16:\r\n\r\n{9C9C9C}1. {FFFFFF}Otimização e desempenho.\r\n{9C9C9C}1. {FFFFFF}BUGs: \r\n- Refinadora\r\n- Editor de Objeto Mobile\r\n- Nascimento da GROTA\r\n- Conquistas (Em testes)\r\n- Coletar drogas do território\r\n- Impedir temporariamente roubo a banco\r\n- Veiculos da Al\'qaeda e Warlocks'),(28,'5.5','2024-08-06 20:55:49','~g~',458624995,'{FFF000}2024-06-25:\n\n{9C9C9C}1. {FFFFFF}RESET PARCIAL: Mais informacoes acesse nosso /discord\n{9C9C9C}2. {FFFFFF}Correcoes no Anti-Cheater Weapon (Em testes...)\n{9C9C9C}3. {FFFFFF}BUGs de duplicacao, dinheiro do banco, refinadora\n{9C9C9C}4. {FFFFFF}Adicionado ID no /rg\n{9C9C9C}5. {FFFFFF}Alguns erros em comandos administrativos');
